import React from 'react';
import "./Projects.css";
import {projects} from '../data'

const Projects = () => {
  return (
    <div class="projects" id="projects">
      <h1>Projects</h1>
      <div class="projects-container">
      {projects.map(data => (
        <div class="info-container">
          <div class="text-info">
          <h3>{data.title}</h3>
          <p>{data.description}</p>
          <a href={data.link} rel="noopener noreferrer" target="_blank">âž¤{data.linkText}</a>
          </div>
          <div>
            <img src={data.img} alt="" />
          </div>
        </div>
      ))}
      </div>
    </div>
  );
};

export default Projects;
